/* Import two hooks, useEffect, useState */
import React, { useEffect, useState } from "react";

export const AlbumList = () => {
  const [albums, setAlbums] = useState([]);

  useEffect(() => {
    fetch("https://swapi.co/api/people/")
      /* Get json */
      .then(res => res.json())
      .then(json => {
        setAlbums(json.people);
      });
  }, []);
};
